class CNN(nn.Module):
def __init__(self):
    super(CNN, self).__init__()
    self.model = nn.Sequential(
        nn.Conv2d(3, 16, 3, 1, 1),
        nn.MaxPool2d(2, 2),
        nn.ReLU(),
        nn.Conv2d(16, 32, 3, 1, 1),
        nn.MaxPool2d(2, 2),
        nn.ReLU(),
        nn.Flatten(),
        nn.Linear(32 * 8 * 8, 10)
    )

def forward(self, x):
    return self.model(x)
